import React from 'react';

function Navbar() {
  return (
    <nav className="navbar">
      <li><a className="a-nav nav-listnav-item-left">stack</a></li>
      <ul className='nav-list'>
        <div style={{marginRight: "2rem"}}></div>
        <div className='nav-item-right'>
          <li><a className="a-nav" href="#about">about</a></li>
          <li><a className="a-nav" href="#projects">projects</a></li>
          <li><a className="a-nav" href="#contact">contact</a></li>
        </div>
      </ul>
    </nav>
  );
}

export default Navbar;
